‚ú®Have you ever had a moment where your basic needs of survival were in question? 

Recently I experienced this on August 18. My husband and I were discussing if we should evacuate our home as we noticed the SCU Lightening Complex fire appeared to be getting closer to our house.  We decided the boys and I should leave while my husband stayed back to be in contact with Cal fire, our 90 year old neighbors and to protect the Blue Oak Ranch Reserve. The kids and I left around 8 PM and for some reason my clicker to the park gate would not open. I got frustrated and decided to drive the half an hour back home. As we pulled up to our house we saw the colors of red, yellow and orange lighting up the hillside behind our house and the sense of panic, fear and our lives flashed before me as I ran out of the car to help my husband grab our animals. I could feel my stomach turn, tears swelling up in my eyes and fear I‚Äôve never felt before wash over me as I got back into the car.  I took a deep breath and pushed it all aside.  I had to be strong for the boys, I had to be brave as my stomach tightened and I wanted to puke. I started driving the other direction out of the Reserve and quickly noticed the fire was also blazing toward the road. I raced back the other way again, but this time following my husband with the key to get us out of the park. We got to our friends house later that night we were safe! #calfirefirefighters #survivalmode #hierarchyofneeds #futureunknown #fear";}i:108;a:1:{s:14:"comments_count";i:2;}i:109;a:1:{s:11:"likes_count";i:1;}i:110;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu4adIALxk";}i:111;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118697584_315780966157097_6461079794802099684_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=EDQKjlGnGg4AX9MaJHH&oh=8ca3d6906dbc60a79684cb2f49e09cfb&oe=5F7A70DB";}i:112;a:1:{s:4:"type";s:7:"sidecar";}i:113;a:1:{s:8:"owner_id";i:5700819231;}i:114;a:1:{s:14:"owner_username";s:0:"";}i:115;a:1:{s:14:"owner_fullname";s:0:"";}i:116;a:1:{s:9:"own